import './About.css';
import img from '../about-me.gif'
function About(){
    return(
        <div className="about">            
            <div className="about-container">
                <article className="about-detail">
                    <h1>Who am I?</h1>
                    <p>Hello guys i am Marc Albert Bautista, 3rd Year BS Computer Science Student. I'm on a mission to soak up as much knowledge as I can, with the ultimate goal of becoming a versatile full-stack and back-end developer. I'm driven to build user-friendly, scalable software that leaves a lasting impression. Beyond that, I'm committed to staying in the loop with the latest industry trends, contributing to open-source projects, and being an active member of developer communities</p>
                </article>
            </div>
            <img src={img}/>
        </div>
    );
}

export default About
